INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 16, 16, 'und', 0, 'Cornell Daily Tech is an all digital tech journal for the Cornell Tech Campus in New York City. Cornell Daily Tech contains daily with news from the ever-changing tech world.', '', 'filtered_html'),
('node', 'page', 0, 17, 17, 'und', 0, 'You can leave us a message by emailing us at some_email@cornelldailytech.com. We do not have a physical address yet, though inquiries about our development and future plans can be directed to the Cornell Daily Sun. ', '', 'filtered_html'),
('node', 'page', 0, 18, 18, 'und', 0, 'The Tech is looking for passionate people interested in writing, editing, designing, and developing for this up-and-coming news site. If you are interested in contributing, please contact us at some_email@cornelldailytech.com. Experience is not required — we will train you to harness the power of the internet — but dedication and interest are critical!', '', 'filtered_html'),
('node', 'article', 0, 20, 20, 'und', 0, 'As recently noted in the New York Daily Times technology bits section, Apple has patented the page turn. Patent D670,713, filed by Apple and approved this week by the United States Patent Office gives Apple the exclusive rights to the page turn in an e-reader application. I did a quick google investigation and discovered that, in fact, “Apple Ridiculous Patents” affords a whole wealth of legalistic laughabilities. To start:\r\n\r\nMethod for providing human input to a computer (Forbes, 2012)\r\n“The invention provides a method for providing human input to a computer which allows a user to interact with a display connected to the computer. The method includes the steps of placing a first target on a first portion of the user’s body, using an electro-optical sensing means, sensing data related to the location of the first target and data related to the location of a second portion of the user’s body, the first and second portions of the user’s body being movable relative to each other, providing an output of the electro-optical sensing means to the input of the computer, determining the location of the first target and the location of the second portion of the user’s body, and varying the output of the computer to the display based upon the determined locations for contemporaneous viewing by the user.”\r\n\r\nThe fabled Rounded Rectangle (Huffington Post, 2012)\r\n“Yes, it''s true: Apple has been granted a patent for the design of the original iPad, which, yes, is a rectangle with round corners. The design, which you can see below, is for the actual shape of the device, so you can ignore the actual screen on the tablet: What has been patented is at the edges, the "ornamental design" of the device”\r\n“A PlayStation-Style Game Controller” (Business insider, 2012)\r\n\r\nApple filed for a patent on a videogame controller in March and was awarded that patent today. The patent describes how the device might interact with iOS devices, but Game Revolution speculates that the Apple TV or rumored full television set could easily be turned into a home gaming system.\r\nThere were more, but in my search I realized that design patents are in a sense fairly ridiculous. They exist to prevent someone from copying an apple design precisely, but are often used inappropriately to lord lawsuits over similar but not exact design decisions. Out of context, we feel like these patents are ridiculous, but perhaps they are inseparable from the social context in which they are created, in which it is natural and necessary to patent of parish at the hands of competitors.\r\n\r\nImage from: The United States Patent and Trademark Office\r\n', '', 'filtered_html'),
('node', 'article', 0, 21, 21, 'und', 0, '(from the Cornell Daily Sun)\r\n\r\nOn the third floor of Upson Hall, 40 students gathered this weekend to begin turning their ideas for new startup companies into reality.\r\n\r\nThe event, called “3 Day Startup,” took “the most talented engineers, designers, M.B.A. students and entrepreneurs on campus and [helped] them create startups over the course of three days,” said Najla Elmachtoub grad ’12, the lead organizer of the event.\r\n\r\n“We bring in mentors from industry, venture capitalists, people who are experts in their field to help these students,” she said. \r\n\r\nBecause of the success of last year’s 3 Day Startup event — in which two companies emerged from the ideas students pitched — the organizers decided to hold the event again this year, according to Elmachtoub.\r\n\r\n “This is definitely something we want to do every year,” said Sohan Jain ’12, last year’s lead organizer who returned this year to serve as the participants’ mentor. \r\n\r\nJain organized the event at Cornell last year after developing an interest in entrepreneurship while working at Facebook the summer before his final semester at Cornell.  \r\n\r\n“At Cornell, I never felt like I was exposed to tech entrepreneurship. When you think of tech entrepreneurship in universities you think of Stanford, MIT and maybe Harvard,” he said. “Cornell was just not known for that. I wanted to bring the culture of Silicon Valley, of tech entrepreneurship, back to Cornell and expose other students to the environment I was surrounded by when I was at Facebook.” \r\n\r\nThe 40 students who participated in 3 Day Startup were chosen from a pool of 150 contenders through an application and subsequent interview process, according to Elmachtoub. \r\n\r\n“We have 40 ideas in the room, and what we do is split them all into groups and [they] negotiate the ideas — convince each other that their ideas are the best,” Elmachtoub said. \r\n\r\nSome of the ideas that emerged over the weekend included creating an app, primarily for college campuses, that identifies the locations of parties on a map; an app, suited for independent filmmakers, that allows its users to control a video camera from an iPad; a product that allows international students to have virtual guidance counselors over video for the fraction of the standard price; and a radio station that changes its music based on the user’s location.\r\n\r\nNick Nickitas grad, a participant in 3 Day Startup, worked on a team that developed Rosie, a smartphone app that will make its users aware when they run low on basic necessity items at home, like paper towels and groceries.\r\n\r\n Nickitas said that 3 Day Startup gave students the ideal environment to create a new business.\r\n\r\n“[3DS] creates the atmosphere for entrepreneurs to be able to grow and thrive. Bringing together a diverse group of people with different backgrounds, with different talent sets and putting them together, almost locking them in a room for a weekend,” he said. “It’s not just a great idea to try and create new ventures, but [also] to cultivate the startup culture that is so important to a place like Cornell.”\r\n\r\nTim Novikoff grad, a mentor for this year’s event, co-started his company — Vantageous — through 3 Day Startup.\r\n\r\nNovikoff acknowledged that there are obvious benefits to joining a large, well-established company and evident risks to founding a startup. \r\n\r\n“Definitely the safe and smart thing to do is to join a large company,” he said. “You make plenty of money, you can live a comfortable life and you have a lot of security. Starting a startup is an insane life choice. It is extremely difficult, you have no money at all for a long time, it could result in absolutely nothing and total failure, and even worse, humiliation if the whole thing falls apart.” \r\n\r\n   After last year’s 3 Day Startup, Nick Fishman ’12 and Arthur Soroken MBA ’12  co-founded the San Francisco-based company sonicpanther. The company’s smartphone app enables users to choose the music playing in the restaurant they are dining at by using their smartphones, according to Fishman. \r\n\r\n“I was planning on doing a Masters of Engineering degree, and then I helped organize 3 Day Startup last November and it got me thinking about entrepreneurship in a way I hadn’t before,” Fishman said. “[Soroken and I] didn’t think [sonicpanther] would go anywhere, but the more and more we worked on it after this event, we realized that this was an actual company and we could actually take this and make it big.” \r\n\r\nFishman said that he supports events such as 3 Day Startup because they encourage students to “get their hands dirty” and delve directly into the world of startups. \r\n\r\n“I really like events like this because they encourage people to talk less and do more,” he said. “You can read about entrepreneurship all day, but if you actually dedicate time to try and build something — even if it does not succeed — you are already attempting and getting into the entrepreneurial spirit, which is the difference between talk and action.” \r\n\r\nDespite the challenges associated with creating startups, Novikoff said that it was ultimately worth the risk for him to pursue startup work. \r\n\r\n“I haven’t gotten a nickel from Vantageous … but it’s not about those things. It’s about the journey of creating a company and creating an organization and hustling. And for me, it’s been worth it because I have enjoyed the journey so far,” he said.\r\n\r\n As he strives to get his own startup off the ground, Novikoff said that he has seen an explosion of entrepreneurial spirit at the University that is not limited to 3 Day Startup. \r\n\r\n“I think that there is a bigger story about 3 Day Startup … that’s part of a growing spirit of entrepreneurialism at Cornell University, both in Ithaca and at the incipient Cornell tech campus in New York,” he said. “I think you are going to see Cornell becoming the world’s top institution [for] turning out entrepreneurs in the next few years.”\r\n\r\nImage source: http://cornell.3daystartup.org/', '', 'filtered_html'),
('node', 'article', 0, 22, 22, 'und', 0, '(from Cornell Daily Sun)\r\n\r\nCornell’s New York City tech campus has named Prof. Rajit Manohar, electrical and computer engineering, its associate dean for academic affairs.\r\n\r\nWhile serving as dean, Manohar will divide his time between teaching at the tech campus and teaching at the Ithaca campus, according to a University press release. He will teach a course called “Physical Computing,” which will provide an introduction to creating smart systems, or devices that can analyze a situation and function in a reactive manner.\r\n\r\nCornellNYC Tech Dean Dan Huttenlocher said Manohar’s previous experience as a researcher and an instructor will serve as an asset in his new position at the tech campus.\r\n\r\n“Rajit exemplifies the kind of faculty that we are hiring as we build CornellNYC Tech, combining research excellence, innovative teaching and a strong entrepreneurial spirit,” Huttenlocher said in the press release.\r\n\r\nProf. Lance Collins, mechanical and aerospace engineering, dean of the College of Engineering, echoed Huttenlocher’s sentiments, saying that Manohar’s experiences will in particular be an asset the entrepreneurial goals of CornellNYC Tech.\r\n\r\n“As associate dean for research and graduate education, Rajit has been actively promoting the college''s entrepreneurial activity, but his new appointment at Cornell Tech will elevate his impact to a whole new level,” Collins said in the press release.\r\n\r\nAfter receiving his bachelor’s and master’s degrees, as well as a Ph.D. from the California Institute of Technology, Manohar came to Cornell in 1998. At the University, he conducts research on asynchronous design, or systems that use timing mechanisms controlled by computers. He also served as Cornell’s associate dean for research and graduate students until June 2012.\r\n\r\nThroughout his career, Manohar has been recognized for his research and academic contributions. Among other honors, he has received the National Science Foundation’s CAREER award, which honors faculty researchers; seven teaching awards; and five awards for papers he has written, according to the press release.\r\n\r\nHe was also named by MIT Technology Review as one of the top 35 young innovators under the age of 35 for his work on designing low-power microprocessors.\r\n\r\nManohar has been a key player in the development of the tech campus, serving as co-chair of the Academic Planning Committee for CornellNYC Tech. He said he is optimistic about the scope of effects of his future work at the tech campus.\r\n\r\n“What students learn at Cornell, real technology and science and engineering ... is something they don’t always realize how much impact they might be able to have, because they don’t see the problems people are facing,” Manohar told The Sun in August. “The tech campus is a place that will be able to have a much closer relationship with real issues that people are facing. It’s a much bigger opportunity to go out and do things that’ll change the world.”\r\n\r\nImage source: http://www.businessinsider.com', '', 'filtered_html'),
('node', 'article', 0, 23, 23, 'und', 0, '(from Cornell Daily Sun)\r\n\r\nOver the course of just 54 hours, Cornell students in this weekend’s 3 Day Startup event built concepts ranging from a software application to improve athletes’ training to an application to turn three iPhones into a three-camera TV studio for multi-angle videos. \r\n\r\nThe event, in which 40 Cornell students worked in six separate groups, sought to promote a culture of entrepreneurship and start-up businesses, according to Najla Elmachtoub ’12, one of the organizers of the event. \r\n\r\nThe event culminated on Sunday night in final pitches from each of the six teams to several panelists and a networking event with several corporate sponsors and employers. \r\nPreviously held at 12 other locations around the world, this was the first 3 Day Startup, or 3DS, to be held at Cornell, Elmachtoub said.  \r\n\r\nSohan Jain ’12, lead organizer for Cornell’s 3DS, first became interested in bringing the event to Cornell after developing an interest in entrepreneurship while working at Facebook over the summer. \r\n\r\n“[This summer] got me thinking because Cornell doesn’t really have that same kind of [entrepreneurial] culture when we look at our peers. We all want to get jobs in tech firms and investment banks … I wanted to bring back some of that culture here,” Jain said.\r\n\r\nAfter discovering the 3DS website through a blog, he connected with the 3DS umbrella organization in September, Jain said. Since then, the 10-member recruiting team, which includes many of Jain’s close friends, worked to organize this event, he said. \r\n\r\nAccording to Elmachtoub, the team accepted the top 40 participants from the applicant pool. Half of the participants were programmers, a fourth were business students and the rest were other Cornellians, Elmachtoub said. \r\n\r\nThe team also recruited mentors and panelists from a variety of fields to critique and guide the participants throughout the weekend, Elmachtoub said.\r\n\r\nAccording to Elmachtoub, the weekend began with Friday afternoon brainstorming sessions, and 14 initial ideas were pitched that night. After the initial pitches, participants broke into six teams, each structured around a different pitch idea, to prepare for the final pitches and networking on Sunday night.\r\n\r\nOn the whole, the participants were very committed to their teams and to the event, Elmachtoub said. \r\n\r\n“[The majority of participants] have been staying here and coding. People leave late at night and come back early in the morning. It’s been awesome to see how people have been forming cultures with their groups,” Elmachtoub said.\r\n\r\nAshley Miller ’06, a mentor, said she was impressed by the way the participants and teams have evolved throughout the weekend.\r\n\r\n“[In the initial pitches,] some were really good and some wouldn’t work. But you could tell they had taken feedback in. I can see from going around the room that things have changed from day to day,” Miller said.\r\n\r\nMiller also emphasized the importance of the event in promoting engineering talent in start-up companies within the Northeast.\r\n\r\n“In New York, there’s a huge need for engineering talent in start-up companies, which is growing fast. You have companies that Cornell alums founded that don’t have a Silicon Valley or Stanford next door. I would like to see more engineers come from Cornell to New York City to work,” Miller said.\r\n\r\nPaul Heran Yang ’12, one of the organizers who also participated in the event, expressed his hope that engineers and business students will be able to form connections and relationships through this event.\r\n\r\n“Cornell does have hackathons [and events similar to 3DS] … but we haven’t ever cooperated with business people, so we can’t maintain those connections,” Yang said.\r\nHarrison Wong ’12, a participant in the event, worked on a team that developed Pocket Studio, an iPhone application that turns three iPhones into a three-camera studio, which is linked to a webservice for video editing.\r\n\r\n“We had the largest team with nine members. One thing I learned is how to get a lot of people working on the same thing without constantly having to talk to each other. Doing a project on your own is easy, but when you have to coordinate with other people, it’s hard. One plus one doesn’t always equal two, but sometimes, 1.5,” Wong said.\r\nAnother participant, Ryan Chowdhury grad, was part of a team that built a software coaching system to help cycling enthusiasts improve their performance. Chowdhury said that his team had some difficulties communicating with each other.\r\n\r\n“It was very tough to communicate through different disciplines. Seeing an MBA talk to an engineer is like the Apprentice meets Big Bang Theory,” Chowdhury said.\r\nAlthough many teams from 3DS events in the past have gone on to develop their ideas into successful start-up companies, this depends largely on the person that had the initial idea, Chowdhury said.\r\n\r\nWhether the idea becomes anything more, “honestly depends because it was one participant’s idea … We liked it and helped him out, but continuing onwards is the real challenge,” Chowdhury said.\r\n\r\nBecause of the success from this past weekend, the organizers hope to make 3DS an annual tradition to continue fostering the spirit of entrepreneurship, Jain said.\r\n\r\n“We will have some leftover funds from this year, and we have already laid the groundwork. I have talked to so many faculty and entrepreneurial groups, and everyone is really excited in backing us [again in the future]. Because the groundwork has been laid, there will be fewer barriers to running another event next year,” Jain said.\r\n', '', 'filtered_html'),
('node', 'article', 0, 24, 24, 'und', 0, '(from Cornell Daily Sun)\r\n\r\nAs other universities and institutions — namely, New York University and Columbia University — develop plans to launch New York City tech campuses of their own, CornellNYC Tech officials have already began looking forward to opportunities for cross-tech campus collaboration.\r\n\r\nCornellNYC Tech Dean Daniel Huttenlocher and Provost Kent Fuchs said they saw the creation of the NYU Center of Urban Science and Progress and the Columbia University Institute for Data Science and Engineering as an opportunity to transform the city into a center of technology preeminence. New York City Mayor Michael Bloomberg announced the creation of the NYU and Columbia tech schools in the spring and summer of this year, respectively.\r\n\r\nHuttenlocher and Fuchs emphasized that the various programs would complement CornellNYC Tech, rather than serve as competition.\r\n\r\n“[These programs] are all really good for all of us. They’re not in any way undercutting what Cornell wants to achieve,” Fuchs said. “It will attract more companies to the city [and] those students that want to start companies will benefit because there will be more of an environment — as a result of these other programs — that will support it. It’s all really, really good news.”\r\n\r\nFuchs added that although all of the tech campuses will launch in NYC, each will focus on different applications of technology innovation. While NYU’s program will primarily teach urban science, Columbia’s emphasis will be on data science, he said.\r\n\r\nThe academic structure of CornellNYC Tech, meanwhile, is organized into three hubs — connective media, healthier life and the built environment — that are broad in scope, but will evolve over time, Fuchs said.\r\n\r\n“The other two programs are more focused than ours is. Ours is broader, intentionally, it’s just bigger — it’s a whole new campus,” Fuchs said. “The second difference is ours has a larger focus on students. All three campuses have a research focus … but [at] ours, the big focus is on the masters students … We believe that the real secret to making a difference and helping the future economy in New York City is the alumni.”\r\n\r\nHuttenlocher added that, based on his understanding of the other projects, CornellNYC Tech’s mission seems to be the most focused on Internet technology.\r\n\r\n“Our view is that almost every industry is being transformed by this new information age,” Huttenlocher said. “This campus is focused on all of those broad uses of information technology to transform industries. In some sense, the 20th Century was the industrial age and the 21st century is the information age.”\r\n\r\nHuttenlocher said that having multiple tech schools could contribute to New York City’s economic growth, making the city a hub of entrepreneurial activity.\r\n\r\n“The big thing is providing an environment where great tech companies are located here in New York — either because they’re homegrown companies that get started by graduates of these programs, or because they’re big companies, like Google and Facebook, and want to build up their operations here,” Huttenlocher said. “It’s really about broadening the economy of New York City to have a much bigger tech component in terms of job opportunities for New Yorkers.”\r\n\r\nHigher education expert and computer scientist Richard DeMillo, who served as the Hewlett-Packard Company’s first chief technology officer and was an executive at the National Science Foundation, said that if NYC is going to create a burgeoning “tech ecosystem,” the presence of multiple tech schools is crucial.\r\n\r\n“I’ve been happy to see Cornell, but also the other New York schools, move in and start to talk about other initiatives, too,” DeMillo said. “Clearly, campuses are competing for resources, but the whole idea of these ventures in New York, as I understand it, is to build up the entire base … Let’s hope that the end result is a larger investment … in building a tech base in [NYC].”\r\n\r\nDeMillo pointed to previous attempts to build up a tech base in the city, citing tech ventures in the mid-1990s that he said had largely failed due to a lack of “openness.” \r\n\r\nThe ability for people to move freely within the tech community and to engage in mentorship “simply didn’t exist in New York City in the mid-90s,” DeMillo said. “So you hope with these new ventures you can somehow recreate the entrepreneurial spirit that’s going to make all of this stuff succeed.”\r\n\r\nIn addition to coordinating with the other two tech schools, CornellNYC Tech is committed to collaborating with tech companies, Fuchs said.\r\n\r\n“We’re not there yet, because we’re focusing on launching our new programs this year and designing buildings and the new campus,” Fuchs said. “But we’re really committed to collaboration … in writing proposals to agencies … and to companies to sponsor new programs. We do that already with other universities around the world.”\r\n\r\nFuchs predicted that this collaborative spirit could extend as far as allowing students to take classes at the peer campuses.\r\n\r\n“There might be students from those other programs that want to take programs on our campus, and possibly the other way around, too,” Fuchs said. “I do predict students will be doing this and getting transfer credit, because we want to offer truly different courses from the ones that are being offered. And the nice thing about New York City is there’s a lot of connectivity, transportation-wise.”\r\n\r\nimage source: http://www.news.cornell.edu/', '', 'filtered_html'),
('node', 'article', 0, 25, 25, 'und', 0, '(from Cornell Daily Sun)\r\n\r\nWhile some professors may discourage texting in class, Prof. Deborah Streeter, applied economics and management, embraces it. In her class AEM 3340: Women, Leadership and Entrepreneurship, Streeter is using texting as an interactive tool to encourage discussion.\r\n\r\nStreeter started using texting to poll students during lecture a few years ago. She said that students were bewildered by the prospect of using their phones in class. \r\n\r\n“Students were shocked when I said ‘everyone get your phone out’ instead of ‘put your devices away,’” Streeter said. She still gets that reaction, she said.\r\n\r\nWhen giving lectures, Streeter uses polleverywhere.com, which allows any device connected to the Internet to respond to a poll. It takes students about 10 seconds to submit an answer and then all responses are immediately displayed on the lecturer’s screen, she said.\r\n\r\nStreeter said her inspiration for the idea came from one of her students, who suggested that cell phones could be used to draw more active engagement from students during class. The rapid polling facilitates conversation in the class, she said.\r\n\r\nAlthough the iClickers used by many professors at Cornell also poll students in class anonymously, Streeter said she found that students did not like them.\r\n\r\nStudents do love their cell phones, though, Streeter said.\r\n\r\nRomi Kher grad, a Ph.D. student in applied economics and management who assists Streeter in the AEM 3340 class, said he supports the use of the polling-through-texting technique in the course.\r\n\r\n“Anonymity makes students comfortable sharing their opinions, and when students see that there are others in class that feel as they do, they are more willing to defend their opinion and this leads to much deeper and meaningful debates in class,” Kher said.\r\n\r\nAshley Pelzel ’14, who is taking the class this semester, also praised the method as having a positive impact on the class.\r\n\r\n“You’re not going to be scared of what to say. We are asked a lot of personal questions and people answer a lot more candidly because of this,” Pelzel said. \r\n\r\nStreeter said students perceive a significant difference between raising their hands and sending text messages in class.\r\n\r\n“Oftentimes discussion is dominated by that one person who always raises his [or] her hand and so we may not always hear the minority speak, so I have been thinking about how to enrich the conversation with students,” she said. “Even the more introverted students who polled are more likely to defend their position, so that was a surprising consequence that added to the inclusivity.”\r\n\r\nKher added that the polling enhances interactions with and between students, including encouraging those who do not speak up in class as often to do so to defend their position.\r\n\r\n“Polling … allows us to know what each student thinks about an issue in seconds and the discussion evolves from their opinions. We are not influenced by the first two to three people who always raise their hand in any class and may take the conversation down a side path,” he said.\r\n\r\nStreeter added that allowing the use of cell phones changed the nature of the course by making the students more relaxed.\r\n\r\nIn addition to her classes at Cornell, Streeter also teaches Flip the Switch Workshops, which are intended to help educators at various schools transform cell phones from distracting devices to interactive classroom tools. The workshops teach professors how to incorporate texting and other technologies, such as video, into their courses.\r\n\r\nJamie Kalousdian, manager of media production for the Dyson School, who works with Streeter to teach the workshops, said educators need to start embracing, rather than discouraging, the use of technology in the classroom.\r\n\r\n“To ask [students] to close their devices is to ask them to cut off their hand. Their phones and devices are so much a part of their life and that is one of the parts that some of the professors don’t understand,” he said.\r\n\r\nSince texting in class, and the use of devices in general, is activity that will only continue to increase, educators need to think of ways to adapt the behavior to serve a productive academic function, Streeter said.\r\n\r\n“Maybe today you can tell students to close their laptops, but in five years their books or notes might be on their mobile devices,” she said.\r\n\r\nimage source: http://en.wikipedia.org/wiki/File:Texting.jpg', '', 'filtered_html'),
('node', 'article', 0, 26, 26, 'und', 0, '(from Cornell Daily Sun)\r\n\r\n\r\nIt’s that time of year again: when September pops up on the calendar, you know you won’t have to look far to find Steve Jobs on a stage somewhere introducing new iPods. This year was certainly no exception, as everyone’s favorite iconic CEO delivered the keynote at Apple’s “Let’s Rock” special event in San Francisco on Tuesday.\r\n\r\nAs the name implies, the event focused on Apple’s booming music business, which includes the iTunes music player, its accompanying online store and the ubiquitous iPod, an entity which, according to Jobs, has now sold over 160 million units for a phenomenal 73.4 percent share of the digital music player market.\r\n\r\n\r\nAll in the family: Apple''s new iPod lineup. From left to right, the iPod touch, iPod classic, iPod nano, and iPod shuffle.\r\nApple was coming off an incredibly busy summer full of highs and lows. On the plus side, they shipped the iPhone 3G, the successor to last year’s iPhone, which sold 1 million units in the opening weekend. This new iPhone has a faster data connection than the old model and sports a shiny new plastic exterior in black or white. Apple also introduced the MobileMe service, which, as a successor to .Mac (pronounced “dot-mac”), allows subscribers to sync their contacts, calendars and email across a wide range of devices such as the Mac, Windows PC and iPhone, all for a modest $99 annual fee.\r\n\r\nUnfortunately, the launches of these great new products were marred by severe technical and economic issues. People who lined up to pick up the iPhone 3G on launch day were greeted by activation server crashes and activation issues, all precipitated by unprecedented demand. Despite the problems, the throng of eager customers continued unabated for several weeks, making it nearly impossible to find the darn thing on (AT&T or Apple) store shelves here in the US. MobileMe similarly buckled under the load of new subscribers, prompting Apple to issue free three-month extensions to all subscribers’ terms.\r\n\r\nSo, on balance, Apple was really looking for a boost coming out of this week’s event. Without the benefit of review units, let me give you a quick look at what they delivered.\r\n\r\nNew iPods. The centerpiece of the exposition was undoubtedly a new, elongated iPod nano in “nano-chromatic,” bright, vibrant colors. The new nano is also getting an accelerometer, allowing users to rotate it into landscape mode for easier browsing in Cover Flow mode and for more optimal viewing of videos and photos. Meanwhile, the iPod touch is also getting an update, with a sleek rounded casing that incorporates physical volume controls and an external speaker. Rounding out the rest of the line, the bulkier 160 GB iPod classic is being eliminated, and its smaller counterpart is getting a bump up to 120 GB while the iPod shuffle is getting a color refresh.\r\n\r\nNew “Genius-”equipped iTunes software. Apple released version 8 of iTunes, the music manager for Mac OS and Windows. The new player features an image-based music browser and a new “Genius” function that is able to scan your library and automatically assemble playlists of songs that “go together.” This function is also on the new iPod nano and touch, as well as current iPod touch users via a software update.\r\n\r\nIn practice, Genius is pretty cool. You are able to click on any song in your library, and with the press of a button iTunes will find all the songs in your library that match that song. This is similar to the functionality that has been provided for a while now by Pandora Radio and similar web sites, but having it built into iTunes and your iPod is a big plus. The only caveat is that its matching algorithm seems to have a few rough edges; when I asked for a Genius playlist based on a song from Coldplay’s recent album “Viva la Vida,” I was given a few odd matches such as one of Paul McCartney’s performances of “The Long and Winding Road,” and Peter Gabriel’s “Red Rain,” which don’t immediately seem to go together. However, Genius will supposedly continue to analyze the data from all its users, and thus I would expect it to improve over time.\r\n\r\nI think the new products bolster Apple’s lineup for the holiday season. Having just bought an iPhone 3G, I won’t personally be in the market for any of the new iPods, but the new nanos should prove attractive to the scores of gift-givers that will begin hitting stores any day now. (Because, you know, shopping for Christmas before Halloween is all the rage nowadays.) If you end up with one, drop by cornellsun.com and let us know how it’s working for you.\r\n\r\nImage source: apple.com', '', 'filtered_html'),
('node', 'article', 0, 27, 27, 'und', 0, '(from Cornell Daily Sun)\r\n\r\nSnavely is working on computer graphics research in an effort to stitch together a digital 3D rendering of entire monuments, cities, and potentially the world.\r\n\r\n“Broadly speaking,” Snavely says, “I’m working on reconstructing the world in 3D from photos on the Internet.” His research is developing techniques to calibrate a “world camera” utilizing the multitude of digital photo data available on the Internet.\r\n\r\nHe is working to stitch together a representation of the world from the data that already exists and is created daily by people around the world. Snavely suggests, “This visual data on the Web represents a massive, distributed camera, made up of millions of sensors around the world.”\r\n\r\nJuxtapositions of photos from online sharing communities such as Flickr and PhotoCity - a site that Snavely launched which challenges Cornell and University of Washington to build 3D models of their campuses - are used to create renderings of various places.  “By comparing these photos to each other, our techniques can reason about the 3D geometry of different photo collections, automatically figuring out where each photo was taken,” explains Snavely.\r\n\r\nThe project has recreated monuments such as the Colosseum, Trevi Fountain, and St. Peter’s Bascillica. They face the challenge of not only processing hundreds of images from many different angles, but also the issue of optimizing said processing. Snavely is practiced in this field of computer graphics and tools. He has contributed photo recognition research, reconstruction research, and co-authored a paper which won runner-up in the 2011 Computer Vision and Patter Recognition Conference.\r\n\r\nThe research, according to Snavely, will be useful in many fields, from tourism to farm management. “Imagine monitoring crop growth, measuring differences in the onset of spring in different places each year, or going back to the photo record to do a kind of forensics –– trying to figure out why a bridge collapsed, for instance –– all from massive collections of photos on the web.” The research will work to preserve data which can be used to depict changes over time or as a tool for educational or promotional purposes.\r\n\r\n“I was inspired to pursue this work by the amazing quantity of imagery available today –– the billions and billions of images on the Web –– and the difficulty in digesting ... all of this visual data,” reflects Snavely. He plans to utilize his Microsoft Fellowship funds in order to expand his research group.\r\n\r\nImage source: http://www.engineering.cornell.edu/research/faculty/new.cfm?year=all', '', 'filtered_html'),
('node', 'article', 0, 28, 28, 'und', 0, '(from Cornell Daily Sun)\r\n\r\nAs a result of a partnership between the University and the U.S. Department of Commerce, Cornell-NYC Tech students will have access to federal resources to support entrepreneurship, according to an announcement made by President David Skorton on Tuesday.\r\n\r\nAs part of the partnership, USPTO staff member Sue Purvis will support technology entrepreneurship both at the tech campus and in the greater New York region. She will help tech campus students start businesses by helping them navigate the patent process and work with the commerce department, according to Dan Huttenlocher, dean of the tech campus.\r\n\r\n“[The partnership is] to assist people in getting connected to the right resources in the federal government [and] to assist commercialization in navigating the patent process, small business loans and grants, trademark types of issues — essentially all the resources the commerce department has for people starting businesses,” Huttenlocher said. \r\n\r\nThe partnership is the first of its kind that the commerce department has made, according to the press release. Through the partnership, the department will be able to obtain feedback about the role it should be playing in the quickly growing field of technology, according to Huttenlocher.\r\n\r\n“It will start a dialogue between the commerce department and the tech campus so the government can learn more about tech innovation and be more informed as it creates programs,” Huttenlocher said.\r\n\r\nHuttenlocher said the partnership between the tech campus and the Commerce Department will work as a “two-way street.”\r\n\r\n“One example is we plan to convene a symposium looking at software patents, which is a very controversial area,” Huttenlocher said. “This is exactly what an academic campus should be doing: getting together experts on controversial issues, having discussions about different viewpoints [and] helping educate and expose people in relevant agencies in government as to what the issues are.”\r\n\r\nLeaders of the commerce department and the Patent Office initiated the partnership with Cornell and will be providing the resources for the venture, according to Huttenlocher. The partnership is considered a pilot program and may be replicated elsewhere, depending on the success of the venture at the tech campus.\r\n\r\nThe partnership illustrates the key role partnerships with outside organizations will play in the development of the tech campus, Huttenlocher said, adding that tech campus administrators have always viewed the involvement of multiple groups –– including academia, government, the business community and the non-profit sector –– as crucial to the tech campus’ success. \r\n\r\nHuttenlocher pointed to last month’s addition of New York City Mayor Michael Bloomberg, Google Executive Chairman Eric Schmidt and former computer science professor and entrepreneur Irwin Jacobs to the tech campus’ advisory board as an example of the formative role different sectors will play in the tech campus.\r\n\r\nPurvis –– who is the innovation and outreach coordinator for the USPTO –– will serve as a liaison between the federal government and the tech campus, according to Huttenlocher. She is based at the tech campus’ temporary headquarters in Chelsea and will move to the Roosevelt Island campus when it is completed. \r\n\r\nPurvis told The Sun that she has worked with the Patent Office since 1998, formerly serving as the advisor to the under-secretary for the deputy director of the office.\r\nAt Cornell, Purvis said she will not be examining patent applications or issuing patents; but instead familiarizing and assisting students with the patent process. \r\n\r\n“The Department of Commerce is made up of a lot of different agencies, and many of them have tools startups can use to help their business,” Purvis said. “I’m going to be a resource they can go to [to] ask questions; I’m going to point them in the direction that will be of assistance to them. If the students have any questions about intellectual property, I can help them out." \r\n\r\nThe specific role the resource center will play in terms of intellectual property on the CornellNYC Tech campus is hard to predict, Huttenlocher said. \r\n\r\n“It’s going to be something that is really up to students and faculty as they start to do their research and educational projects,” Huttenlocher said. “We’re really just at the stage where we’re putting infrastructure in place to make it easy for people to do things … it’s just too soon to tell.”\r\n\r\nImage source: http://5.mshcdn.com/wp-content/uploads/2012/10/cornell-nyc-tech-640.jpg', '', 'filtered_html');
