INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(16, 'node', ' about cornell daily tech is an all digital tech journal for the cornell tech campus in new york city cornell daily tech contains daily with news from the everchanging tech world  ', 0),
(17, 'node', ' contact you can leave us a message by emailing us at someemail cornelldailytechcom  we do not have a physical address yet though inquiries about our development and future plans can be directed to the cornell daily sun  ', 0),
(18, 'node', ' join the sun the tech is looking for passionate people interested in writing editing designing and developing for this upandcoming news site if you are interested in contributing please contact us at someemail cornelldailytechcom  experience is not required we will train you to harness the power of the internet but dedication and interest are critical  ', 0),
(20, 'node', ' apple patents page turn a compendium of ridiculous patents as recently noted in the new york daily times technology bits section apple has patented the page turn patent d670713 filed by apple and approved this week by the united states patent office gives apple the exclusive rights to the page turn in an ereader application i did a quick google investigation and discovered that in fact apple ridiculous patents affords a whole wealth of legalistic laughabilities to start method for providing human input to a computer forbes 2012 the invention provides a method for providing human input to a computer which allows a user to interact with a display connected to the computer the method includes the steps of placing a first target on a first portion of the user s body using an electrooptical sensing means sensing data related to the location of the first target and data related to the location of a second portion of the user s body the first and second portions of the user s body being movable relative to each other providing an output of the electrooptical sensing means to the input of the computer determining the location of the first target and the location of the second portion of the user s body and varying the output of the computer to the display based upon the determined locations for contemporaneous viewing by the user the fabled rounded rectangle huffington post 2012 yes it s true apple has been granted a patent for the design of the original ipad which yes is a rectangle with round corners the design which you can see below is for the actual shape of the device so you can ignore the actual screen on the tablet what has been patented is at the edges the ornamental design of the device a playstationstyle game controller business insider 2012 apple filed for a patent on a videogame controller in march and was awarded that patent today the patent describes how the device might interact with ios devices but game revolution speculates that the apple tv or rumored full television set could easily be turned into a home gaming system there were more but in my search i realized that design patents are in a sense fairly ridiculous they exist to prevent someone from copying an apple design precisely but are often used inappropriately to lord lawsuits over similar but not exact design decisions out of context we feel like these patents are ridiculous but perhaps they are inseparable from the social context in which they are created in which it is natural and necessary to patent of parish at the hands of competitors image from the united states patent and trademark office tags  apple patent software ', 0),
(21, 'node', ' students create startups at entrepreneurship event  from the cornell daily sun on the third floor of upson hall 40 students gathered this weekend to begin turning their ideas for new startup companies into reality the event called 3 day startup took the most talented engineers designers mba students and entrepreneurs on campus and helped them create startups over the course of three days said najla elmachtoub grad 12 the lead organizer of the event we bring in mentors from industry venture capitalists people who are experts in their field to help these students she said because of the success of last year s 3 day startup event in which two companies emerged from the ideas students pitched the organizers decided to hold the event again this year according to elmachtoub this is definitely something we want to do every year said sohan jain 12 last year s lead organizer who returned this year to serve as the participants mentor jain organized the event at cornell last year after developing an interest in entrepreneurship while working at facebook the summer before his final semester at cornell at cornell i never felt like i was exposed to tech entrepreneurship when you think of tech entrepreneurship in universities you think of stanford mit and maybe harvard he said cornell was just not known for that i wanted to bring the culture of silicon valley of tech entrepreneurship back to cornell and expose other students to the environment i was surrounded by when i was at facebook the 40 students who participated in 3 day startup were chosen from a pool of 150 contenders through an application and subsequent interview process according to elmachtoub we have 40 ideas in the room and what we do is split them all into groups and they negotiate the ideas convince each other that their ideas are the best elmachtoub said some of the ideas that emerged over the weekend included creating an app primarily for college campuses that identifies the locations of parties on a map an app suited for independent filmmakers that allows its users to control a video camera from an ipad a product that allows international students to have virtual guidance counselors over video for the fraction of the standard price and a radio station that changes its music based on the user s location nick nickitas grad a participant in 3 day startup worked on a team that developed rosie a smartphone app that will make its users aware when they run low on basic necessity items at home like paper towels and groceries nickitas said that 3 day startup gave students the ideal environment to create a new business 3ds creates the atmosphere for entrepreneurs to be able to grow and thrive bringing together a diverse group of people with different backgrounds with different talent sets and putting them together almost locking them in a room for a weekend he said it s not just a great idea to try and create new ventures but also to cultivate the startup culture that is so important to a place like cornell tim novikoff grad a mentor for this year s event costarted his company vantageous through 3 day startup novikoff acknowledged that there are obvious benefits to joining a large wellestablished company and evident risks to founding a startup definitely the safe and smart thing to do is to join a large company he said you make plenty of money you can live a comfortable life and you have a lot of security starting a startup is an insane life choice it is extremely difficult you have no money at all for a long time it could result in absolutely nothing and total failure and even worse humiliation if the whole thing falls apart after last year s 3 day startup nick fishman 12 and arthur soroken mba 12 cofounded the san franciscobased company sonicpanther the company s smartphone app enables users to choose the music playing in the restaurant they are dining at by using their smartphones according to fishman i was planning on doing a masters of engineering degree and then i helped organize 3 day startup last november and it got me thinking about entrepreneurship in a way i hadn t before fishman said soroken and i didn t think sonicpanther would go anywhere but the more and more we worked on it after this event we realized that this was an actual company and we could actually take this and make it big fishman said that he supports events such as 3 day startup because they encourage students to get their hands dirty and delve directly into the world of startups i really like events like this because they encourage people to talk less and do more he said you can read about entrepreneurship all day but if you actually dedicate time to try and build something even if it does not succeed you are already attempting and getting into the entrepreneurial spirit which is the difference between talk and action despite the challenges associated with creating startups novikoff said that it was ultimately worth the risk for him to pursue startup work i haven t gotten a nickel from vantageous but it s not about those things it s about the journey of creating a company and creating an organization and hustling and for me it s been worth it because i have enjoyed the journey so far he said as he strives to get his own startup off the ground novikoff said that he has seen an explosion of entrepreneurial spirit at the university that is not limited to 3 day startup i think that there is a bigger story about 3 day startup that s part of a growing spirit of entrepreneurialism at cornell university both in ithaca and at the incipient cornell tech campus in new york he said i think you are going to see cornell becoming the world s top institution for turning out entrepreneurs in the next few years image source  http cornell3daystartuporg  tags  entrepreneurship 3ds ', 0),
(22, 'node', ' cornell professor named associate dean of tech campus  from cornell daily sun cornell s new york city tech campus has named prof rajit manohar electrical and computer engineering its associate dean for academic affairs while serving as dean manohar will divide his time between teaching at the tech campus and teaching at the ithaca campus according to a university press release he will teach a course called physical computing which will provide an introduction to creating smart systems or devices that can analyze a situation and function in a reactive manner cornellnyc tech dean dan huttenlocher said manohar s previous experience as a researcher and an instructor will serve as an asset in his new position at the tech campus rajit exemplifies the kind of faculty that we are hiring as we build cornellnyc tech combining research excellence innovative teaching and a strong entrepreneurial spirit huttenlocher said in the press release prof lance collins mechanical and aerospace engineering dean of the college of engineering echoed huttenlocher s sentiments saying that manohar s experiences will in particular be an asset the entrepreneurial goals of cornellnyc tech as associate dean for research and graduate education rajit has been actively promoting the college s entrepreneurial activity but his new appointment at cornell tech will elevate his impact to a whole new level collins said in the press release after receiving his bachelor s and master s degrees as well as a phd from the california institute of technology manohar came to cornell in 1998 at the university he conducts research on asynchronous design or systems that use timing mechanisms controlled by computers he also served as cornell s associate dean for research and graduate students until june 2012 throughout his career manohar has been recognized for his research and academic contributions among other honors he has received the national science foundation s career award which honors faculty researchers seven teaching awards and five awards for papers he has written according to the press release he was also named by mit technology review as one of the top 35 young innovators under the age of 35 for his work on designing lowpower microprocessors manohar has been a key player in the development of the tech campus serving as cochair of the academic planning committee for cornellnyc tech he said he is optimistic about the scope of effects of his future work at the tech campus what students learn at cornell real technology and science and engineering is something they don t always realize how much impact they might be able to have because they don t see the problems people are facing manohar told the sun in august the tech campus is a place that will be able to have a much closer relationship with real issues that people are facing it s a much bigger opportunity to go out and do things that ll change the world image source  http wwwbusinessinsidercom tags  campus news ', 0),
(23, 'node', ' students develop startups in 54 hours  from cornell daily sun over the course of just 54 hours cornell students in this weekend s 3 day startup event built concepts ranging from a software application to improve athletes training to an application to turn three iphones into a threecamera tv studio for multiangle videos the event in which 40 cornell students worked in six separate groups sought to promote a culture of entrepreneurship and startup businesses according to najla elmachtoub 12 one of the organizers of the event the event culminated on sunday night in final pitches from each of the six teams to several panelists and a networking event with several corporate sponsors and employers previously held at 12 other locations around the world this was the first 3 day startup or 3ds to be held at cornell elmachtoub said sohan jain 12 lead organizer for cornell s 3ds first became interested in bringing the event to cornell after developing an interest in entrepreneurship while working at facebook over the summer this summer got me thinking because cornell doesn t really have that same kind of entrepreneurial culture when we look at our peers we all want to get jobs in tech firms and investment banks i wanted to bring back some of that culture here jain said after discovering the 3ds website through a blog he connected with the 3ds umbrella organization in september jain said since then the 10member recruiting team which includes many of jain s close friends worked to organize this event he said according to elmachtoub the team accepted the top 40 participants from the applicant pool half of the participants were programmers a fourth were business students and the rest were other cornellians elmachtoub said the team also recruited mentors and panelists from a variety of fields to critique and guide the participants throughout the weekend elmachtoub said according to elmachtoub the weekend began with friday afternoon brainstorming sessions and 14 initial ideas were pitched that night after the initial pitches participants broke into six teams each structured around a different pitch idea to prepare for the final pitches and networking on sunday night on the whole the participants were very committed to their teams and to the event elmachtoub said the majority of participants have been staying here and coding people leave late at night and come back early in the morning it s been awesome to see how people have been forming cultures with their groups elmachtoub said ashley miller 6 a mentor said she was impressed by the way the participants and teams have evolved throughout the weekend in the initial pitches some were really good and some wouldn t work but you could tell they had taken feedback in i can see from going around the room that things have changed from day to day miller said miller also emphasized the importance of the event in promoting engineering talent in startup companies within the northeast in new york there s a huge need for engineering talent in startup companies which is growing fast you have companies that cornell alums founded that don t have a silicon valley or stanford next door i would like to see more engineers come from cornell to new york city to work miller said paul heran yang 12 one of the organizers who also participated in the event expressed his hope that engineers and business students will be able to form connections and relationships through this event cornell does have hackathons and events similar to 3ds but we haven t ever cooperated with business people so we can t maintain those connections yang said harrison wong 12 a participant in the event worked on a team that developed pocket studio an iphone application that turns three iphones into a threecamera studio which is linked to a webservice for video editing we had the largest team with nine members one thing i learned is how to get a lot of people working on the same thing without constantly having to talk to each other doing a project on your own is easy but when you have to coordinate with other people it s hard one plus one doesn t always equal two but sometimes 15 wong said another participant ryan chowdhury grad was part of a team that built a software coaching system to help cycling enthusiasts improve their performance chowdhury said that his team had some difficulties communicating with each other it was very tough to communicate through different disciplines seeing an mba talk to an engineer is like the apprentice meets big bang theory chowdhury said although many teams from 3ds events in the past have gone on to develop their ideas into successful startup companies this depends largely on the person that had the initial idea chowdhury said whether the idea becomes anything more honestly depends because it was one participant s idea we liked it and helped him out but continuing onwards is the real challenge chowdhury said because of the success from this past weekend the organizers hope to make 3ds an annual tradition to continue fostering the spirit of entrepreneurship jain said we will have some leftover funds from this year and we have already laid the groundwork i have talked to so many faculty and entrepreneurial groups and everyone is really excited in backing us again in the future because the groundwork has been laid there will be fewer barriers to running another event next year jain said tags  entrepreneurship 3ds ', 0),
(24, 'node', ' cornell says other nyc tech schools will improve not hurt cornellnyc tech  from cornell daily sun as other universities and institutions namely new york university and columbia university develop plans to launch new york city tech campuses of their own cornellnyc tech officials have already began looking forward to opportunities for crosstech campus collaboration cornellnyc tech dean daniel huttenlocher and provost kent fuchs said they saw the creation of the nyu center of urban science and progress and the columbia university institute for data science and engineering as an opportunity to transform the city into a center of technology preeminence new york city mayor michael bloomberg announced the creation of the nyu and columbia tech schools in the spring and summer of this year respectively huttenlocher and fuchs emphasized that the various programs would complement cornellnyc tech rather than serve as competition these programs are all really good for all of us they re not in any way undercutting what cornell wants to achieve fuchs said it will attract more companies to the city and those students that want to start companies will benefit because there will be more of an environment as a result of these other programs that will support it it s all really really good news fuchs added that although all of the tech campuses will launch in nyc each will focus on different applications of technology innovation while nyu s program will primarily teach urban science columbia s emphasis will be on data science he said the academic structure of cornellnyc tech meanwhile is organized into three hubs connective media healthier life and the built environment that are broad in scope but will evolve over time fuchs said the other two programs are more focused than ours is ours is broader intentionally it s just bigger it s a whole new campus fuchs said the second difference is ours has a larger focus on students all three campuses have a research focus but at ours the big focus is on the masters students we believe that the real secret to making a difference and helping the future economy in new york city is the alumni huttenlocher added that based on his understanding of the other projects cornellnyc tech s mission seems to be the most focused on internet technology our view is that almost every industry is being transformed by this new information age huttenlocher said this campus is focused on all of those broad uses of information technology to transform industries in some sense the 20th century was the industrial age and the 21st century is the information age huttenlocher said that having multiple tech schools could contribute to new york city s economic growth making the city a hub of entrepreneurial activity the big thing is providing an environment where great tech companies are located here in new york either because they re homegrown companies that get started by graduates of these programs or because they re big companies like google and facebook and want to build up their operations here huttenlocher said it s really about broadening the economy of new york city to have a much bigger tech component in terms of job opportunities for new yorkers higher education expert and computer scientist richard demillo who served as the hewlettpackard company s first chief technology officer and was an executive at the national science foundation said that if nyc is going to create a burgeoning tech ecosystem the presence of multiple tech schools is crucial i ve been happy to see cornell but also the other new york schools move in and start to talk about other initiatives too demillo said clearly campuses are competing for resources but the whole idea of these ventures in new york as i understand it is to build up the entire base let s hope that the end result is a larger investment in building a tech base in nyc demillo pointed to previous attempts to build up a tech base in the city citing tech ventures in the mid1990s that he said had largely failed due to a lack of openness the ability for people to move freely within the tech community and to engage in mentorship simply didn t exist in new york city in the mid90s demillo said so you hope with these new ventures you can somehow recreate the entrepreneurial spirit that s going to make all of this stuff succeed in addition to coordinating with the other two tech schools cornellnyc tech is committed to collaborating with tech companies fuchs said we re not there yet because we re focusing on launching our new programs this year and designing buildings and the new campus fuchs said but we re really committed to collaboration in writing proposals to agencies and to companies to sponsor new programs we do that already with other universities around the world fuchs predicted that this collaborative spirit could extend as far as allowing students to take classes at the peer campuses there might be students from those other programs that want to take programs on our campus and possibly the other way around too fuchs said i do predict students will be doing this and getting transfer credit because we want to offer truly different courses from the ones that are being offered and the nice thing about new york city is there s a lot of connectivity transportationwise image source  http wwwnewscornelledu  tags  campus news ', 0),
(25, 'node', ' aem professor to students don t put away cell phones  from cornell daily sun while some professors may discourage texting in class prof deborah streeter applied economics and management embraces it in her class aem 3340 women leadership and entrepreneurship streeter is using texting as an interactive tool to encourage discussion streeter started using texting to poll students during lecture a few years ago she said that students were bewildered by the prospect of using their phones in class students were shocked when i said everyone get your phone out instead of put your devices away streeter said she still gets that reaction she said when giving lectures streeter uses polleverywherecom which allows any device connected to the internet to respond to a poll it takes students about 10 seconds to submit an answer and then all responses are immediately displayed on the lecturer s screen she said streeter said her inspiration for the idea came from one of her students who suggested that cell phones could be used to draw more active engagement from students during class the rapid polling facilitates conversation in the class she said although the iclickers used by many professors at cornell also poll students in class anonymously streeter said she found that students did not like them students do love their cell phones though streeter said romi kher grad a phd student in applied economics and management who assists streeter in the aem 3340 class said he supports the use of the pollingthroughtexting technique in the course anonymity makes students comfortable sharing their opinions and when students see that there are others in class that feel as they do they are more willing to defend their opinion and this leads to much deeper and meaningful debates in class kher said ashley pelzel 14 who is taking the class this semester also praised the method as having a positive impact on the class you re not going to be scared of what to say we are asked a lot of personal questions and people answer a lot more candidly because of this pelzel said streeter said students perceive a significant difference between raising their hands and sending text messages in class oftentimes discussion is dominated by that one person who always raises his or her hand and so we may not always hear the minority speak so i have been thinking about how to enrich the conversation with students she said even the more introverted students who polled are more likely to defend their position so that was a surprising consequence that added to the inclusivity kher added that the polling enhances interactions with and between students including encouraging those who do not speak up in class as often to do so to defend their position polling allows us to know what each student thinks about an issue in seconds and the discussion evolves from their opinions we are not influenced by the first two to three people who always raise their hand in any class and may take the conversation down a side path he said streeter added that allowing the use of cell phones changed the nature of the course by making the students more relaxed in addition to her classes at cornell streeter also teaches flip the switch workshops which are intended to help educators at various schools transform cell phones from distracting devices to interactive classroom tools the workshops teach professors how to incorporate texting and other technologies such as video into their courses jamie kalousdian manager of media production for the dyson school who works with streeter to teach the workshops said educators need to start embracing rather than discouraging the use of technology in the classroom to ask students to close their devices is to ask them to cut off their hand their phones and devices are so much a part of their life and that is one of the parts that some of the professors don t understand he said since texting in class and the use of devices in general is activity that will only continue to increase educators need to think of ways to adapt the behavior to serve a productive academic function streeter said maybe today you can tell students to close their laptops but in five years their books or notes might be on their mobile devices she said image source  http enwikipediaorg wiki file textingjpg tags  software ', 0),
(26, 'node', ' i spy new ipods  from cornell daily sun it s that time of year again when september pops up on the calendar you know you won t have to look far to find steve jobs on a stage somewhere introducing new ipods this year was certainly no exception as everyone s favorite iconic ceo delivered the keynote at apple s let s rock special event in san francisco on tuesday as the name implies the event focused on apple s booming music business which includes the itunes music player its accompanying online store and the ubiquitous ipod an entity which according to jobs has now sold over 160 million units for a phenomenal 734 percent share of the digital music player market all in the family apple s new ipod lineup from left to right the ipod touch ipod classic ipod nano and ipod shuffle apple was coming off an incredibly busy summer full of highs and lows on the plus side they shipped the iphone 3g the successor to last year s iphone which sold 1 million units in the opening weekend this new iphone has a faster data connection than the old model and sports a shiny new plastic exterior in black or white apple also introduced the mobileme service which as a successor to mac pronounced dotmac allows subscribers to sync their contacts calendars and email across a wide range of devices such as the mac windows pc and iphone all for a modest 99 annual fee unfortunately the launches of these great new products were marred by severe technical and economic issues people who lined up to pick up the iphone 3g on launch day were greeted by activation server crashes and activation issues all precipitated by unprecedented demand despite the problems the throng of eager customers continued unabated for several weeks making it nearly impossible to find the darn thing on at t or apple store shelves here in the us mobileme similarly buckled under the load of new subscribers prompting apple to issue free threemonth extensions to all subscribers terms so on balance apple was really looking for a boost coming out of this week s event without the benefit of review units let me give you a quick look at what they delivered new ipods the centerpiece of the exposition was undoubtedly a new elongated ipod nano in nanochromatic bright vibrant colors the new nano is also getting an accelerometer allowing users to rotate it into landscape mode for easier browsing in cover flow mode and for more optimal viewing of videos and photos meanwhile the ipod touch is also getting an update with a sleek rounded casing that incorporates physical volume controls and an external speaker rounding out the rest of the line the bulkier 160 gb ipod classic is being eliminated and its smaller counterpart is getting a bump up to 120 gb while the ipod shuffle is getting a color refresh new genius equipped itunes software apple released version 8 of itunes the music manager for mac os and windows the new player features an imagebased music browser and a new genius function that is able to scan your library and automatically assemble playlists of songs that go together this function is also on the new ipod nano and touch as well as current ipod touch users via a software update in practice genius is pretty cool you are able to click on any song in your library and with the press of a button itunes will find all the songs in your library that match that song this is similar to the functionality that has been provided for a while now by pandora radio and similar web sites but having it built into itunes and your ipod is a big plus the only caveat is that its matching algorithm seems to have a few rough edges when i asked for a genius playlist based on a song from coldplay s recent album viva la vida i was given a few odd matches such as one of paul mccartney s performances of the long and winding road and peter gabriel s red rain which don t immediately seem to go together however genius will supposedly continue to analyze the data from all its users and thus i would expect it to improve over time i think the new products bolster apple s lineup for the holiday season having just bought an iphone 3g i won t personally be in the market for any of the new ipods but the new nanos should prove attractive to the scores of giftgivers that will begin hitting stores any day now because you know shopping for christmas before halloween is all the rage nowadays if you end up with one drop by cornellsuncom and let us know how it s working for you image source applecom tags  hardware reviews ', 0),
(27, 'node', ' prof snavely named microsoft fellow  from cornell daily sun snavely is working on computer graphics research in an effort to stitch together a digital 3d rendering of entire monuments cities and potentially the world broadly speaking snavely says i m working on reconstructing the world in 3d from photos on the internet his research is developing techniques to calibrate a world camera utilizing the multitude of digital photo data available on the internet he is working to stitch together a representation of the world from the data that already exists and is created daily by people around the world snavely suggests this visual data on the web represents a massive distributed camera made up of millions of sensors around the world juxtapositions of photos from online sharing communities such as flickr and photocity a site that snavely launched which challenges cornell and university of washington to build 3d models of their campuses are used to create renderings of various places by comparing these photos to each other our techniques can reason about the 3d geometry of different photo collections automatically figuring out where each photo was taken explains snavely the project has recreated monuments such as the colosseum trevi fountain and st peter s bascillica they face the challenge of not only processing hundreds of images from many different angles but also the issue of optimizing said processing snavely is practiced in this field of computer graphics and tools he has contributed photo recognition research reconstruction research and coauthored a paper which won runnerup in the 2011 computer vision and patter recognition conference the research according to snavely will be useful in many fields from tourism to farm management imagine monitoring crop growth measuring differences in the onset of spring in different places each year or going back to the photo record to do a kind of forensics trying to figure out why a bridge collapsed for instance all from massive collections of photos on the web the research will work to preserve data which can be used to depict changes over time or as a tool for educational or promotional purposes i was inspired to pursue this work by the amazing quantity of imagery available today the billions and billions of images on the web and the difficulty in digesting all of this visual data reflects snavely he plans to utilize his microsoft fellowship funds in order to expand his research group image source  http wwwengineeringcornelledu research faculty newcfm year all tags  campus news ', 0),
(28, 'node', ' cornellnyc tech partners with us department of commerce  from cornell daily sun as a result of a partnership between the university and the us department of commerce cornellnyc tech students will have access to federal resources to support entrepreneurship according to an announcement made by president david skorton on tuesday as part of the partnership uspto staff member sue purvis will support technology entrepreneurship both at the tech campus and in the greater new york region she will help tech campus students start businesses by helping them navigate the patent process and work with the commerce department according to dan huttenlocher dean of the tech campus the partnership is to assist people in getting connected to the right resources in the federal government and to assist commercialization in navigating the patent process small business loans and grants trademark types of issues essentially all the resources the commerce department has for people starting businesses huttenlocher said the partnership is the first of its kind that the commerce department has made according to the press release through the partnership the department will be able to obtain feedback about the role it should be playing in the quickly growing field of technology according to huttenlocher it will start a dialogue between the commerce department and the tech campus so the government can learn more about tech innovation and be more informed as it creates programs huttenlocher said huttenlocher said the partnership between the tech campus and the commerce department will work as a twoway street one example is we plan to convene a symposium looking at software patents which is a very controversial area huttenlocher said this is exactly what an academic campus should be doing getting together experts on controversial issues having discussions about different viewpoints and helping educate and expose people in relevant agencies in government as to what the issues are leaders of the commerce department and the patent office initiated the partnership with cornell and will be providing the resources for the venture according to huttenlocher the partnership is considered a pilot program and may be replicated elsewhere depending on the success of the venture at the tech campus the partnership illustrates the key role partnerships with outside organizations will play in the development of the tech campus huttenlocher said adding that tech campus administrators have always viewed the involvement of multiple groups including academia government the business community and the nonprofit sector as crucial to the tech campus success huttenlocher pointed to last month s addition of new york city mayor michael bloomberg google executive chairman eric schmidt and former computer science professor and entrepreneur irwin jacobs to the tech campus advisory board as an example of the formative role different sectors will play in the tech campus purvis who is the innovation and outreach coordinator for the uspto will serve as a liaison between the federal government and the tech campus according to huttenlocher she is based at the tech campus temporary headquarters in chelsea and will move to the roosevelt island campus when it is completed purvis told the sun that she has worked with the patent office since 1998 formerly serving as the advisor to the undersecretary for the deputy director of the office at cornell purvis said she will not be examining patent applications or issuing patents but instead familiarizing and assisting students with the patent process the department of commerce is made up of a lot of different agencies and many of them have tools startups can use to help their business purvis said i m going to be a resource they can go to to ask questions i m going to point them in the direction that will be of assistance to them if the students have any questions about intellectual property i can help them out the specific role the resource center will play in terms of intellectual property on the cornellnyc tech campus is hard to predict huttenlocher said it s going to be something that is really up to students and faculty as they start to do their research and educational projects huttenlocher said we re really just at the stage where we re putting infrastructure in place to make it easy for people to do things it s just too soon to tell image source  http 5mshcdncom wpcontent uploads 201210 cornellnyctech640jpg tags  campus news patent wars ', 0);
